import React from "react";
import MetricsGrid   from "../components/metrics/MetricsGrid";
import LiveChart     from "../components/charts/LiveChart";
import VolumeChart   from "../components/charts/VolumeChart";
import LogStream     from "../components/logs/LogStream";
import AlertsPanel   from "../components/alerts/AlertsPanel";
import ServicesTable from "../components/logs/ServicesTable";

const C = {
  cyan:"#00D4FF", green:"#3FB950", red:"#F85149", amber:"#D29922",
  void:"#0D1117", surface:"#161B22", border:"#21262D",
  text:"#E6EDF3", muted:"#7D8590",
};
const mono = { fontFamily:"'JetBrains Mono',monospace" };

/* â”€â”€ Optimization Summary Banner (shown when a result exists) â”€ */
function OptimizationBanner({ result, onViewKitting }) {
  const savingColor = result.estimated_cost_savings_percent >= 30 ? C.green
    : result.estimated_cost_savings_percent >= 15 ? C.cyan : C.amber;

  return (
    <div style={{
      background: C.void,
      border: `1px solid rgba(63,185,80,0.25)`,
      padding: "14px 20px",
      display: "flex", alignItems: "center", gap: 20,
      flexWrap: "wrap", position: "relative", overflow: "hidden",
    }}>
      <div style={{ position:"absolute",top:0,left:0,right:0,height:1,
        background:`linear-gradient(90deg,${C.green} 0%,transparent 50%)`,opacity:0.5 }}/>

      <div style={{ ...mono,fontSize:10,fontWeight:600,color:C.green,
        textTransform:"uppercase",letterSpacing:"0.1em",flexShrink:0 }}>
        âœ“ LATEST OPTIMIZATION RESULT
      </div>

      {[
        { label:"ORIGINAL UNITS",  value: result.original_boq_items,                          color:C.muted  },
        { label:"OPTIMIZED KITS",  value: result.optimized_kits_required,                     color:C.cyan   },
        { label:"REPETITION",      value: `Ã—${result.total_repetition_factor}`,                color:C.green  },
        { label:"COST SAVINGS",    value: `${result.estimated_cost_savings_percent}%`,          color:savingColor },
        { label:"ðŸŒ± COâ‚‚ SAVED",    value: `${Math.round(((result.original_boq_items - result.optimized_kits_required) * 1200 * 1.85) / 1000)}t`, color:"#22C55E" },
        { label:"KIT TYPES",       value: result.kit_details?.length ?? "â€”",color:C.cyan   },       ].map(k => (
        <div key={k.label} style={{ display:"flex",flexDirection:"column",gap:2 }}>
          <div style={{ ...mono,fontSize:9,color:C.muted,textTransform:"uppercase",letterSpacing:"0.08em" }}>{k.label}</div>
          <div style={{ ...mono,fontSize:16,fontWeight:700,color:k.color }}>{k.value}</div>
        </div>
      ))}

      <button onClick={onViewKitting}
        style={{ marginLeft:"auto",...mono,fontSize:10,fontWeight:600,
          background:"none",border:`1px solid rgba(63,185,80,0.4)`,color:C.green,
          padding:"6px 14px",cursor:"pointer",letterSpacing:"0.06em" }}>
        VIEW KITTING PLAN â†’
      </button>
    </div>
  );
}

/* â”€â”€ CTA Banner (shown when no result yet) â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€ */
function GetStartedBanner({ onGoToInput }) {
  return (
    <div style={{
      background: C.void,
      border: `1px dashed rgba(0,212,255,0.2)`,
      padding: "16px 20px",
      display: "flex", alignItems: "center", justifyContent: "space-between",
      gap: 16, flexWrap: "wrap",
    }}>
      <div>
        <div style={{ ...mono,fontSize:12,fontWeight:700,color:C.text,marginBottom:4 }}>
          FORMWORK KITTING OPTIMIZER
        </div>
        <div style={{ ...mono,fontSize:10,color:C.muted }}>
          Input your BoQ elements â†’ ML engine optimizes kits â†’ See cost savings & repetition plan
        </div>
      </div>
      <button onClick={onGoToInput}
        style={{ background:C.cyan,border:"none",color:"#080B12",...mono,
          fontSize:11,fontWeight:700,padding:"8px 20px",cursor:"pointer",
          letterSpacing:"0.06em",whiteSpace:"nowrap",
          boxShadow:"0 0 16px rgba(0,212,255,0.25)" }}>
        â–¶ START OPTIMIZATION
      </button>
    </div>
  );
}

/* â”€â”€ Main â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€ */
export default function OverviewPage({
  metrics, spark,
  cpuData, memData, rpsData, barData,
  logs,
  optimizationResult,
  onCardClick, onLogClick, onAlertClick, onServiceClick,
  onGoToInput, onRefresh, push,
}) {
  return (
    <>
      {/* Optimization result banner / CTA */}
      {optimizationResult
        ? <OptimizationBanner result={optimizationResult} onViewKitting={onGoToInput} />
        : <GetStartedBanner onGoToInput={onGoToInput} />
      }

      {/* Metric cards */}
      <MetricsGrid metrics={metrics} spark={spark} onCardClick={onCardClick} />

      {/* Live chart */}
      <LiveChart cpuData={cpuData} memData={memData} rpsData={rpsData} onRefresh={onRefresh} />

      {/* Logs + Alerts */}
      <div style={{ display:"grid", gridTemplateColumns:"1fr 340px", gap:14 }}>
        <LogStream logs={logs} onLogClick={onLogClick} />
        <AlertsPanel
          onAlertClick={onAlertClick}
          onAcknowledge={() => push({ title:"All Acknowledged", msg:"All alerts marked as resolved" }, "ok")}
        />
      </div>

      {/* Volume chart + Service table */}
      <div style={{ display:"grid", gridTemplateColumns:"1fr 1fr", gap:14 }}>
        <VolumeChart data={barData} />
        <ServicesTable
          onRowClick={onServiceClick}
          onViewAll={() => push({ title:"Services", msg:"Showing all services" }, "info")}
        />
      </div>
    </>
  );
}
